import { FiMenu } from 'react-icons/fi'

const Navbar = () => {
  return (
    <header className='container border-solid border-gray-200 border-b-2 h-4 p-4 sticky inset-0 flex flex-row-reverse items-center '>
      {window.innerWidth < 640 && <FiMenu className='text-2xl cursor-pointer hover:bg-gray-200 inline-block ' />}
      <img url='../../../public/svgLogo/logo-quera-heavy.1-1c1287ee3575.svg'></img>
    </header>
  );
}

export default Navbar;
